/*
        qWat - QGIS Water Module

        SQL file :: vl_pipe_nominal_pressure
*/

DROP TABLE IF EXISTS qwat.vl_pipe_nominal_pressure CASCADE;
CREATE TABLE qwat.vl_pipe_nominal_pressure ( id integer NOT NULL, CONSTRAINT "vl_pipe_nominal_pressure_pk" PRIMARY KEY (id) );
COMMENT ON TABLE qwat.vl_pipe_nominal_pressure IS 'Possible combinations between external/internal diameters of PE pipes with respect to the nominal pressure.

Important note:
This table isn''t yet merged in the qwat logic but it should be included in the future.

Standard dimension ratio (SDR) is a method of rating a pipe''s durability against pressure. The standard dimension ratio describes the correlation between the pipe dimension and the thickness of the pipe wall.

SDR = external diameter (mm) / wall thickness (mm)

Pipes with a lower SDR can withstand higher pressure. Common nominations are SDR11 and SDR17.';

/* COLUMNS*/
ALTER TABLE qwat.vl_pipe_nominal_pressure ADD COLUMN diameter_nominal smallint;
ALTER TABLE qwat.vl_pipe_nominal_pressure ADD COLUMN diameter_internal numeric(7,3);
ALTER TABLE qwat.vl_pipe_nominal_pressure ADD COLUMN diameter_external numeric(7,3);
ALTER TABLE qwat.vl_pipe_nominal_pressure ADD COLUMN pressure_nominal double precision;
ALTER TABLE qwat.vl_pipe_nominal_pressure ADD COLUMN sdr double precision;
ALTER TABLE qwat.vl_pipe_nominal_pressure ADD COLUMN wall_thickness numeric(4,1);
ALTER TABLE qwat.vl_pipe_nominal_pressure ADD COLUMN material_name text;
ALTER TABLE qwat.vl_pipe_nominal_pressure ADD COLUMN id_material integer;

COMMENT ON COLUMN qwat.vl_pipe_nominal_pressure.pressure_nominal IS 'nominal pressure in bars';
COMMENT ON COLUMN qwat.vl_pipe_nominal_pressure.wall_thickness IS 'in mm';
COMMENT ON COLUMN qwat.vl_pipe_nominal_pressure.id_material IS 'Describes the corresponding value for vl_pipe_material';

/* TRIGGER */
CREATE OR REPLACE FUNCTION qwat.update_internal_diameter()
  RETURNS trigger AS
$BODY$
        BEGIN
                 NEW.diameter_internal := NEW.diameter_external-2*NEW.wall_thickness;
                 RETURN NEW;
        END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;
COMMENT ON FUNCTION qwat.update_internal_diameter() IS 'Updates the internal diameter based on diameter_external,wall_thickness values';
CREATE TRIGGER update_pipe_internal_diameter
  BEFORE INSERT OR UPDATE OF diameter_external, wall_thickness
  ON qwat.vl_pipe_nominal_pressure
  FOR EACH ROW
  EXECUTE PROCEDURE qwat.update_internal_diameter();

CREATE OR REPLACE FUNCTION qwat.update_wall_thickness_values()
  RETURNS trigger AS
$BODY$
        BEGIN
                 NEW.wall_thickness := (NEW.diameter_external-NEW.diameter_internal)/2;
                 RETURN NEW;
        END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;
COMMENT ON FUNCTION qwat.update_wall_thickness_values() IS 'Updates the wall thickness based on diameter_external/internal values';
CREATE TRIGGER update_pipe_wall_thickness
  BEFORE INSERT OR UPDATE OF diameter_internal, diameter_external
  ON qwat.vl_pipe_nominal_pressure
  FOR EACH ROW
  EXECUTE PROCEDURE qwat.update_wall_thickness_values();


